import { Outlet, Link } from "react-router-dom";
import React from "react";

export default function Router() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">LandingPage</Link>
          </li>
          <li>
            <Link to="standings">StandingsPage</Link>
          </li>
        </ul>
      </nav>
    </>
  );
}
